INSERT INTO `tb_plant` VALUES ('14', '非洲菊', 'gerbera jamesonii', '扶郎花', '', '南非', '中国', '直径≥10厘米，高度≥15厘米', '开花期11月至4月，观赏期3-4周', '花色橙色、粉色', '菊科，非洲菊属', 'Asteraceae, Gerbera', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('15', '非洲紫罗兰', 'Saintpaulia ionantha', '非洲堇', '', '东非', '中国', '直径≥10厘米，高度≥10厘米', '开花期为一年四季', '花色紫色、白色、粉红色', '苦苣苔科，非洲堇属', 'Gesneriaceae, Saintpaulia', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('16', '凤仙花', 'impatiens balsamina', '金凤花,灯盏花,好女儿花,指甲花', '花语：美丽、生动、魅力无穷\n凤仙花是中国东关市的官方花卉。花朵像一只蝴蝶，有多种颜色，如白色、粉色、紫色和红色。叶子绿色，呈披针形。花和叶子可以捣碎，包在女孩的手指甲上，画出新鲜的颜色，就像指甲花一样。', '中国', '中国', '直径≥10厘米，高度≥10厘米', '开花期6-10月，观赏期1-2个月', '花色白色、粉红色、紫色', '凤仙花科，凤仙花属', 'Balsaminaceae, Impatiens', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('17', '甘蔗', 'saccharum officinarum', '黑蔗、拔地拉、黄皮果蔗、糖蔗', '', '热带和亚热带地区', '中国', '直径≥10cm，高度≥20cm', '经济型作物', '花色 灰色 白色', '禾本科，甘蔗属', 'Poaceae, Saccharum', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('18', '含羞草', 'mimosa pudica', '怕羞草、害羞草、怕丑草、呼喝草、知羞草', '花语：害羞、内敛、有礼貌\n含羞草纯洁、清新、可爱。它被命名为害羞草，因为它的叶子会被外界触摸而关闭。\n羞草的颜色是绿色的。叶子呈分叶状排列。通常是四个小叶子呈掌状排列，看起来像一个小手掌，非常活泼。用手触摸或用水，叶柄就会脱出，小叶就会闭合。夏季过后，它会开花。花是白色或粉红色的绒球，迷人而可爱。', '美洲热带地区', '华南地区', '直径≥10厘米，高度≥15厘米', '开花期9-10月，观赏期3-7天', '叶色嫩绿，花色白色或粉红色', ' 豆科，含羞草属', 'Fabaceae, Mimosa', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('19', '桔梗', 'platycodon grandiflorus', '铃铛花、包袱花', '', '中国、日本', '中国', '直径≥10厘米，高度≥15厘米', '开花期7-9月', '花色深蓝、深紫白', '桔梗科，桔梗属', 'Campanulaceae, Platycodon', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('20', '君子兰', 'clivia miniata', '剑叶石蒜、大叶石蒜', '花语：温和、谦逊、仁慈\n君子兰是中国长春市的官方花卉。具有厚实的深绿色叶片，以整齐优美的对称方式对立排列，花葶从叶片中间出现，上面有漏斗状的花朵。花色有橙红色、黄色、白色和红色。由于它的好看和耐阴性，常用于家庭装饰。', '非洲', '中国', '直径≥10厘米，高度≥15厘米', '开花期1-2月，全年开花，观赏期1-2个月', '花色橙红，黄色，白色，红色', '石蒜科，君子兰属', 'Amaryllidaceae, Clivia', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('21', '蜡梅', 'chimonanthus praecox', '大叶蜡梅、狗矢蜡梅、狗蝇梅、腊梅、磬口蜡梅、黄梅花', '花语：骄傲、坚强、忠诚\n凤仙花在雪中傲然绽放，与兰、竹、菊合称花中 \"四君子\"，被命名为武汉市花。\n腊梅植株强壮坚挺，漂亮。叶片椭圆，花朵娇艳欲滴，内阁。颜色多样，花瓣有单瓣和复瓣之分。梅花香自苦寒来，象征着中华民族坚强的精神品质', '中国', '中国', '直径≥10厘米，高度≥15厘米', '开花期11月至3月，观赏期1-2周', '花色纯黄色，淡黄色，金黄，白色，黄白色等', '蜡梅科，蜡梅属', 'Calycanthaceae, Chimonanthus', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('22', '铃兰', 'convallaria majalis', '君影草、芦藜花、草玉玲', '花语：快乐、纯洁、美丽。\n铃兰是一种小型草本植物。叶子是绿色的，大而圆的椭圆形。花朵小而精致，呈钟形，低垂。花的颜色是优雅的白色、粉红色或蓝色。气味宜人，令人心旷神怡。园林用途包括花坛、边缘和家庭花盆。', '中国', '中国', '直径≥10厘米，高度≥15厘米', '开花期5-6月，观赏期2-3周', '花色 白色、蓝色、粉红色', '天门冬科，铃兰属', 'Asparagaceae, Convallaria', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('23', '木棉', 'bombax ceiba', '攀枝、斑芝树、斑芝棉、攀枝花、英雄树、红棉', '花语：珍贵、温暖、美丽\n木棉是广州的市花。茎秆粗壮，早春花前叶后，花团锦簇，花瓣五片，肉质，椭圆形，红色或橙红色，在树上开花如火，也叫 \"英雄花\"。', '亚洲', '中国', '直径≥10厘米，高度≥15厘米', '开花期3-4月，观赏期2-3周', '花色为红色或橙红色', '锦葵科，木棉属', 'Malvaceae, Bombax', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('24', '南瓜', 'cucurbita moschata', '北瓜、番南瓜、饭瓜、番瓜、倭瓜', '', '北美洲和中美洲', '中国', '直径≥10厘米，可攀爬', '开花期5-7月，结果期7-9月', '花色黄，花色黄，果色橙黄或青色', '葫芦科，南瓜属', 'Cucurbitaceae, Cucurbita', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('25', '蒲苇', 'cortaderia selloana', '蒲苇', '', '阿根廷', '上海、南京、北京', '直径≥20厘米，高20-30厘米', '开花期9-10月', '花色 银白色', '禾本科，蒲苇属', 'Poaceae, Cortaderia', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('26', '软枣猕猴桃', 'actinidia arguta', '软枣子、紫果猕猴桃、心叶猕猴桃', '', '中国', '中国', '直径≥20厘米，高度≥30厘米', '开花期5-6月，结果期8-10月', '花色乳白色或浅黄色，果实颜色深褐色', '猕猴桃科，猕猴桃属', 'Actinidiaceae, Actinidia', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('27', '睡莲', 'nymphaea tetragona', '子午莲、水芹花、瑞莲、水洋花、小莲花', '', '北非、东南亚 热带地区', '中国', '直径≥10厘米，高度≥15厘米', '开花期6-8月', '花色为白色、蓝色、黄色或粉红色', 'Nymphaeaceae, Nymphaea', 'Nymphaeaceae, Nymphaea', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('28', '豌豆', 'pisum sativum', '青豆、麦豌豆、寒豆', '', '西亚，地中海地区', '中国', '直径≥10厘米，可攀爬', '开花和结果期 4-5月', '花色白色、紫红色，果色蓝绿色、黄白色、红色、棕色、黑色', '豆科，豌豆属', 'Fabaceae, Pisum', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('29', '西瓜', 'citrullus lanatus', '水瓜、寒瓜、夏瓜', '', '非洲', '中国', '直径25-35厘米，可以攀爬', '开花期4-7月，结果期7-9月', '花色黄色，果色绿色、深绿色、黄色', '葫芦科，西瓜属', 'Cucurbitaceae, Citrullus', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('30', '荨麻', 'urtica fissa', '刺麻，刺麻，防盗草，茅草，蝎子草', '', '亚洲', '中国', '直径≥10厘米，高度≥15厘米', '开花期8-10月', '叶色绿色，花色白色至黄绿色', '荨麻科，荨麻属', 'Urticaceae, Urtica', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('31', '银杏', 'Ginkgo biloba', '鸭掌树、鸭脚子、公孙树、白果', '', '中国', '中国', '直径≥15厘米，高度≥25厘米', '开花期4月，结果期10月', '花色橙黄', '银杏科，银杏属', 'Ginkgoaceae, Ginkgo', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('32', '虞美人', 'papaver rhoeas', '丽春花、赛牡丹、满园春、仙女蒿', '', '欧洲', '中国', '直径≥10厘米，高度≥15厘米', '开花和结果期 3-8月', '花色红色、白色、黄色、紫色', '罂粟科，罂粟属', 'Papaveraceae, Papaver', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('33', '鸢尾', 'Iris tectorum', '蓝蝴蝶、紫蝴蝶、扁竹花', '花语：美丽、自由和阳光\n鸢尾花是非常美丽的花朵，也被称为蓝蝴蝶，属于中型多年生根茎植物。\n鸢尾花花形独特，花瓣大而华丽，花色大多有彩虹色和条纹，所以其拉丁文Iris来源于希腊神话中的彩虹女神。', '荷兰', '云南', '直径≥10厘米，高度≥15厘米', '开花期4-5月，观赏期1-2周', '花色蓝色、紫色、红色、橙色', '鸢尾科，鸢尾属', 'Iridaceae, Iris', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('34', '月桂', 'laurus nobilis', '香叶', '', '地中海地区', '华南地区', '直径≥20厘米，高20-30厘米', '开花期3-5月，结果期6-9月', '花色浅黄，果色紫褐', '樟科，月桂属', 'Lauraceae, Laurus', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('35', '紫薇', 'lagerstroemia indica', '痒痒树、蚊子花、紫兰花、紫金花、痒痒花', '花语：快乐、美丽、同情。\n叶子是逆向的椭圆形，绿色。皱纹花优雅地簇拥在茎顶。因其花期长而被广泛栽培于庭院、花园和花盆中。', '亚洲', '中国', '直径≥10厘米，高度≥15厘米', '开花期6-9月，观赏期3-4周', '花色 红色、深粉色、紫色、白色', '千屈菜科，紫薇属', 'Lythraceae, Lagerstroemia', null, 'data:image/jpeg;base64,');
INSERT INTO `tb_plant` VALUES ('36', '龟背竹', 'Monstera deliciosa', '裂叶飞龙', '龟背竹 -- 俗称裂叶飞龙是一种流行的家庭植物，实际上不在喜林芋属植物。其特点是大而有光泽的心形叶子，从叶子的边缘裂开到中心静脉。', '中国', '中国', '谭然', '谭然', '谭然', '谭然', null, '1', 'https://upload.wikimedia.org/wikipedia/commons/2/2e/Monstera_deliciosa2.jpg');
INSERT INTO `tb_plant` VALUES ('37', '鹅掌柴', 'Schefflera arboricola', '鹅掌柴', '鹅掌柴，被称为伞形植物，是一种易于种植的室内植物，可以容忍一系列的生长条件。鹅掌柴能够种植在整个家庭的许多房间里，因为它可以容忍中等光照。', null, null, null, null, null, null, null, '1', 'https://upload.wikimedia.org/wikipedia/commons/8/82/Schefflera_arboricola%2C_vrugte%2C_a%2C_Pretoria.jpg');
INSERT INTO `tb_plant` VALUES ('38', '金心巴西铁', 'Dracaena fragrans \'Massangeana\'', '香龙血树、巴西木、巴西铁树、巴西千年木', '香龙血树，又称巴西木，是一种非常容易种植的植物。作为大多数植物初学者的首选，这种植物可以承受高光和低光的情况，使它很容易放在家里的大多数地方。', null, null, null, null, null, null, null, '1', 'https://cdn.shopify.com/s/files/1/1706/1307/products/Dracaena-fragrans-Massangeana-Multi-Stem.jpg?v=1544879538');
INSERT INTO `tb_plant` VALUES ('39', '吊竹梅', 'Tradescantia zebrina', '吊竹兰、水龟草', '吊竹梅是一种易于种植的家庭植物，茎部呈蔓型。如果种植在盆中，吊竹梅会在桌子上生长，如果种植在吊篮中，则会在周围悬挂。', null, null, null, null, null, null, null, '1', 'https://www.ourhouseplants.com/imgs-content/wandering_jew_plant.jpg');
INSERT INTO `tb_plant` VALUES ('40', '国王椰子', 'Ravenea rivularis (Majesty Palm)', '国王椰子', '国王椰子是一种生长缓慢的家庭植物，有能力填补你家里的空白角落。它们可爱的叶子也能在户外阴凉处生长，为你的户外生活空间增添质感。', null, null, null, null, null, null, null, '1', 'https://upload.wikimedia.org/wikipedia/commons/5/5b/Ravenearivularis.jpg');
INSERT INTO `tb_plant` VALUES ('41', '芋', 'colocasia esculenta (Elephant Ear)', '芋头、象耳', '象耳的名字名副其实，它长着巨大的叶片。这些植物拥有各种颜色的生长形态--因此找到适合你和你的家的植物并不困难。', null, null, null, null, null, null, null, '1', 'https://images.homedepot-static.com/productImages/a6764b94-4af9-4e00-902b-69f03a8014aa/svn/garden-state-bulb-flower-bulbs-hos19-06-64_1000.jpg');
INSERT INTO `tb_plant` VALUES ('42', '虹之玉(多肉植物)', 'Sedum robrotinctum', '耳坠草', '耳坠草是一种似气泡状外观的植物，有红色的绿色叶片。这种植物向上生长，直到植物生长的重量趋向于使其倾斜。', null, null, null, null, null, null, null, '1', 'https://www.easternleaf.com/v/vspfiles/photos/806570-03-2.jpg');
INSERT INTO `tb_plant` VALUES ('43', '翡翠珠', 'Senencio rowleyanus', '一串珠、绿铃、佛珠、项链掌', '一串珠，也被称为翡翠珠，生长在长长的藤蔓上，可以在吊盆中漂亮地展示。这种藤蔓不需要很多照顾，只要确保不过度浇水，它在大多数家庭都会很合适。', null, null, null, null, null, null, null, '1', 'https://cdn.shopify.com/s/files/1/1752/4567/products/string_of_pearls.png?v=1522299713');
INSERT INTO `tb_plant` VALUES ('44', '英冠玉', 'Parodia magnifica', '英冠玉', '英冠玉是一种球状的仙人掌，成簇生长。它的特点是呈蓝绿色，每根刺上都长有黄色的刺。这种仙人掌在夏季和初秋时节可以开出明亮的黄色花朵。随着时间的推移，可长到12英寸高。', null, null, null, null, null, null, null, '1', 'http://cdn.shopify.com/s/files/1/0284/2450/products/Notocactus_magnificus-1_600x.jpg?v=1507917159');
INSERT INTO `tb_plant` VALUES ('45', '雪铁芋', 'Zamioculcas zamiifolia', '金钱树、龙凤木、泽米芋、扎米莲、美铁芋', '金钱树是最容易种植的室内植物之一。金钱树的深绿色叶片为你的家增添了可爱的外观，无论你是植物新手还是专家，这种植物都能满足你的植物目标。', null, null, null, null, null, null, null, '1', 'https://images.homedepot-static.com/productImages/22b7f2be-265e-4572-8246-bea85069604a/svn/costa-farms-house-plants-6zz-64_1000.jpg');
INSERT INTO `tb_plant` VALUES ('46', '虎尾兰', 'Sansevieria trifasciata', '虎皮兰、锦兰、黄尾兰或岳母舌', '虎皮兰是一种常绿的多年生植物，形成密集的植株，通过其匍匐的根茎传播，根茎有时在地上，有时在地下。它的硬叶从一个基底莲座上垂直生长。成熟的叶子是深绿色的，有浅灰绿色的横纹，通常有70-90厘米(28-35英寸)长。', null, null, null, null, null, null, null, '1', 'https://images-na.ssl-images-amazon.com/images/I/81ZTxjet2cL._SX425_.jpg');
INSERT INTO `tb_plant` VALUES ('47', '绿萝', 'Epipremnum aureum', '黄金葛、万年青、魔鬼藤、黄金藤', '绿萝是天南星科麒麟叶属的一种植物，原产于法属波利尼西亚社会群岛的莫奥雷亚。该物种在温带地区是一种受欢迎的室内植物，但在世界各地的热带和亚热带森林中也已归化，包括澳大利亚北部、东南亚、南亚、太平洋群岛和西印度群岛，在某些情况下它已造成严重的生态破坏。', null, null, null, null, null, null, null, '1', 'https://images-na.ssl-images-amazon.com/images/I/81m0IBljM-L._SX425_.jpg');
INSERT INTO `tb_plant` VALUES ('48', '大琴叶榕', 'Ficus lyrata', '琴叶榕、琴叶橡皮树', '大琴叶榕，俗称琴叶榕，是桑科和无花果科的一种开花植物。它原产于非洲西部，从喀麦隆西部到塞拉利昂，生长在低地热带雨林中。它是一种榕树无花果（Ficus subgenus Urostigma），通常以附生在另一棵树的树冠上开始生活。', null, null, null, null, null, null, null, '1', 'https://images-na.ssl-images-amazon.com/images/I/81wLZzFMfvL._SL1500_.jpg');
INSERT INTO `tb_plant` VALUES ('49', '镜面草', 'Pilea peperomioides', '一点金、金线草、翠屏草', '镜面草是荨麻科荨麻属的一种开花植物，原产于中国南方的云南和四川省，被称为一点金、金线草、翠屏草或镜子草。', null, null, null, null, null, null, null, '0', 'https://images-na.ssl-images-amazon.com/images/I/71Mu-27B53L._SX425_.jpg');
INSERT INTO `tb_plant` VALUES ('50', '斑叶垂椒草', 'Peperomia serpens ‘Variegata’', '蔓性椒草、假蔓绿绒、月光椒草、花叶椒草', '斑叶垂椒草是一种引人注目的杂色植物，叶子有独特的图案，呈乳黄色和淡绿色，边框为深绿色。多汁的叶子是厚的和蜡质的。有时被列为斑叶垂椒草。', null, null, null, null, null, null, null, '0', 'https://houseplants.studleys.com/wp-content/uploads/2016/03/Peperomia-Golden-Gate-1-400x300.jpg');
INSERT INTO `tb_plant` VALUES ('51', '小蝴蝶空气凤梨', 'Tillandsia bulbosa', '空气凤梨', '小蝴蝶空气凤梨是一种鳞茎状的气生植物。它的特点是可爱的卷须，是一种华丽的深绿色，当你欣赏它时，它似乎在移动和挥舞。小蝴蝶空气凤梨是任何家庭或办公室的一个美丽装饰。有人说，它光滑的长臂就像一个海洋生物。', null, null, null, null, null, null, null, '0', 'https://cdn.shopify.com/s/files/1/0049/0822/products/strepto_wood_stump_1_of_1_68f87272-e719-444a-8417-678321e88ccc.jpg?v=1518179917');
INSERT INTO `tb_plant` VALUES ('52', '库拉索芦荟', 'Aloe Barbadensis', '芦荟', '芦荟是一种无茎或极短茎的植物，可长到60-100厘米(24-39英寸)高，通过分枝蔓延。叶子厚而肉质，绿色至灰绿色，一些品种的茎部上下表面有白色斑点。叶子边缘有锯齿，有白色小齿。', null, null, null, null, null, null, null, '1', 'https://images-na.ssl-images-amazon.com/images/I/61In86UTGDL._SL1500_.jpg');
INSERT INTO `tb_plant` VALUES ('53', '洋常春藤', 'Hedera helix', '常春藤、长春藤、西洋长春藤', '洋常春藤，通常被称为常春藤，是一种有活力的、积极的、快速生长的、木质的常绿多年生植物，主要作为攀缘藤本植物或蔓生地被种植。作为攀缘藤本植物，随着时间的推移，它的高度可能超过50-100英尺。作为地面覆盖物，它通常长到6-9英寸高，但随着时间的推移会蔓延到50-100英尺。', null, null, null, null, null, null, null, '1', 'https://i.pinimg.com/564x/ee/f1/16/eef116850ddbcb2d8a970dc7fedb363e.jpg');
INSERT INTO `tb_plant` VALUES ('54', '印度榕', 'Ficus elastica', '橡皮树、印度胶树', '橡皮树是最常见的用作家庭盆栽的榕树植物之一。橡皮树的养护是一项需要适度关注的任务。橡皮树需要一个非常湿润但排水良好的环境，良好的光照和阴凉的平衡，以及在其生命过程中不同的施肥方案。', null, null, null, null, null, null, null, '1', 'https://i.pinimg.com/564x/5d/5d/c5/5d5dc55e54689fbd48526c8e3de1b258.jpg');
INSERT INTO `tb_plant` VALUES ('55', '西洋菜', null, null, '受古希腊人和罗马人欢迎的欧芹，随着第一批殖民者被带到了美洲。虽然欧芹是两年生植物，但它们通常被作为一年生蔬菜种植。欧洲防风草是一种耐寒的冷季作物，最好在严霜过后收割。欧洲防风草不仅在汤和炖菜中味道鲜美，而且还可以自己享用。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('56', '卷心菜', null, null, '卷心菜是一种坚韧的、充满维生素的多叶蔬菜。它可能很难种植；它只喜欢凉爽的温度，而且它可能是某种类型害虫的磁铁。通过规划你的种植季节并提供勤奋的照料，你可能在一年中成功地种植两季作物，包括春季和秋季。有许多品种可以满足你的生长条件和口味偏好。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('57', '茄子', null, null, '茄子是短命的多年生蔬菜，但通常被当作一年生植物栽培。茄子也被称为茄子，主要在果实的大小、形状和颜色上有所不同。茄子属于热带和亚热带地区，需要相对较高的温度。相关作物包括西红柿、马铃薯和辣椒。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('58', '西兰花', null, null, '西兰花是一种冷季作物，与菠菜一样，可以在春季或秋季种植。事实上，如果你的种植时间正确，你可能在两个季节都能获得持续的收获。作为卷心菜家族的一员，西兰花富含维生素。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('59', '哈密瓜', null, null, '我们通常所说的 \"哈密瓜 \"实际上不是真正的哈密瓜，而是一种麝香甜瓜。(真正的哈密瓜有一个粗糙的疣状外皮，在美国没有广泛种植或商业供应）。麝香甜瓜是一种喜热的水果，生长期很长。它们的文化和生长要求与其他瓜类非常相似。它们有一个网状的棕褐色果皮，果肉为甜橙色。麝香甜瓜和哈密瓜这两个名字可以互换使用。为避免混淆，我们将在本页面使用哈密瓜这一名称。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('60', '洋葱', null, null, '洋葱是一种冷季作物，因其耐寒而易于种植。我们建议使用洋葱套种，可以不用担心冻害，而且比直接播种或移植的成功率更高。洋葱在高架床或至少4英寸高的高架行上生长良好。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('61', '豌豆', null, null, '豌豆是一种冷季作物，现在有三个独立的品种，以满足你的花园和烹饪需要。它们是Pisum savitum，包括花园豌豆（甜豌豆，不可食用的豆荚）和雪豌豆（可食用的扁豆荚，里面有小豌豆），以及Pisum macrocarpon，豆角（可食用的豆荚，有全尺寸的豌豆）。它们很容易种植，但生长季节非常有限。此外，它们在收获后不会保持很长时间的新鲜度，所以要趁早享受它们!', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('62', '萝卜', null, null, '萝卜是两年生植物，通常作为一年生植物种植。虽然芜菁草在欧洲的厨房里更像是主食，但许多南方的园丁喜欢种植它们的绿色植物。芜菁草最多需要两个月的时间才能成熟。芜菁草在温带气候下生长最好，但可以忍受轻度霜冻。秋天的作物通常比春天的作物更甜更嫩，而且虫害问题不大。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('63', '百里香', null, null, '百里香是一种多年生小灌木，有很多枝条，开浅紫色到粉红色的花。它有香气，有一种令人愉快的、辛辣的、三叶草的味道。有超过50个品种用于烹饪和园艺。英国百里香在烹饪中最常使用。\n', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('64', '高丽菜', null, null, '油菜是一种耐寒的冷季绿色蔬菜，是卷心菜家族的一部分。它们在春季和秋季生长最好，并能容忍所有秋季的霜冻。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('65', '菠菜', null, null, '这种超级耐寒的蔬菜是一种柔嫩的作物，可以在很早的春天以及秋天和冬天种植。菠菜的生长条件和要求与莴苣相似，但它的营养和生吃或熟吃的能力都更全面。它的铁、钙和维生素含量高于大多数栽培的绿色蔬菜，是维生素A、B和C的最佳来源之一。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('66', '牛至', null, null, '牛至是一种多年生植物，开玫瑰紫色或白色的花，味道让人想起百里香。它的味道鲜美而强烈，常用于意大利菜。牛至是一种耐寒植物，是一种良好的地面覆盖物。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('67', '秋葵', null, null, '秋葵传统上是美国南部的一种植物，在温暖的天气中茁壮成长。它很容易种植和使用，由于其美丽的花朵，在整个生长季节看起来都很好。秋葵还含有丰富的维生素A和低卡路里。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('68', '欧芹', null, null, '欧芹是一种两年生植物，叶片呈鲜绿色，呈羽毛状，与莳萝同属一个家族。这种草药可用于汤、酱汁和沙拉，它可以减少汤中对盐的需求。它不仅是完美的装饰品，而且还很健康；它富含铁和维生素A和C。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('69', '圣人', null, null, '鼠尾草是一种坚韧的多年生植物，叶片柔软，呈灰绿色。它的花色各不相同，可以是紫色、粉色、蓝色或白色。普通鼠尾草最常用于烹饪；它是馅料中的经典。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('70', '莳萝', null, null, '莳萝是一种一年生的自播植物，有羽毛状的绿色叶片。它最常用于汤、炖菜和腌制。莳萝很容易种植，可以吸引有益的昆虫到你的花园，如黄蜂和其他捕食性昆虫。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('71', '芫荽', null, null, '芫荽/香菜是一种快速生长的芳香型草本植物，在春秋两季的凉爽天气中生长。这种草药被用来为许多食谱调味，整个植物都可以食用。叶子被称为香菜，种子被称为芫荽。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('72', '甘蓝', null, null, '甘蓝是一种耐寒的冷季绿色蔬菜，属于卷心菜家族。它在春季和秋季生长最好，可以忍受所有秋季霜冻。羽衣甘蓝可用于沙拉或作为装饰品，富含矿物质和维生素A和C。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('73', '芹菜', null, null, '芹菜是一种长季节作物，种植起来很棘手，有人会说是最棘手的。它喜欢肥沃的土壤、凉爽的温度和持续的水分。它不耐高温，也很难移植。北方的夏季作物和南方的冬季作物使得芹菜可以全年生产。当你收获松脆的绿色茎秆时，所有的工作都是值得的。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('74', '冬季南瓜', null, null, '南瓜是一种季节性蔬菜。它非常容易受到霜冻和高温的损害，但如果照顾得当，它将以极少的植株生产出丰收的作物。夏季南瓜有许多品种可供选择，包括西葫芦。冬季和夏季品种之间的主要区别是它们的收获时间；较长的生长期使冬季南瓜的皮更硬，不能食用', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('75', '大黄', null, null, '大黄是一种多年生蔬菜，尽管它通常被用作甜点和果酱的水果。你只吃茎部，它有浓郁的酸味。这种植物的叶子是有毒的，所以要确保不被摄入。大黄很容易种植，但需要凉爽的天气才能茁壮成长。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('76', '龙蒿', null, null, '龙蒿是一种多年生草本植物，有长而浅绿色的叶子，开绿色或黄色的白色小花。在烹饪时，使用法国龙蒿。俄罗斯龙蒿很容易被误认为是法国龙蒿，但是俄罗斯龙蒿比法国龙蒿更粗，味道更淡。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('77', '马铃薯', null, null, '这种半耐寒的蔬菜是一种烹饪主食，但却被许多后院园丁所忽视。自家种植的马铃薯的味道和口感远远优于商店购买的，特别是早期品种。它们需要凉爽的气候，而且还需要注意防止晒伤。马铃薯可以作为冬季作物在气候较暖的地区种植。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('78', '豆类', null, null, '杆豆和灌木豆（通常称为青豆）是一种鲜嫩的蔬菜，是任何花园的最佳补充，可以新鲜食用，也可以放入食谱中食用。灌木豆需要较少的维护，所以它们更容易种植。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('79', '西瓜', null, null, '在夏季，似乎每个人都喜欢多汁的西瓜。西瓜原产于非洲，需要温暖的温度（白天可达80度）和漫长的生长期。气候较冷的园丁仍然可以通过在室内播种并选择短季节的品种来成功种植西瓜。到成熟的天数从70天到90天不等，取决于品种。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('80', '甜玉米', null, null, '甜玉米是一年生植物，有黄色、白色和双色的玉米穗。种植后需要一个漫长的无霜期。甜玉米是风媒，所以应该分块种植，而不是单行种植。早、中、晚季节的品种可以延长收获期。如果错过最佳收获期，随着糖分转化为淀粉，玉米会迅速走下坡路。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('81', '芦笋', null, null, '芦笋是一种多年生球茎类蔬菜，每年春天迎接我们的到来。它可能需要2到3年的时间才能开始生产，所以需要耐心!但后来这种植物的产量可以达到20年，所以我们认为值得等待。芦笋有雄株和雌株，雌株会产生浆果。冬季凉爽的地区最适合这种冷季作物的生长。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('82', '大蒜', null, null, '大蒜很容易种植，经过漫长的生长季节，会产生大量的球茎。它具有耐霜冻性。除了其强烈的味道和烹饪用途外，\"臭玫瑰 \"在花园里可以作为驱虫剂，几个世纪以来一直被用作家庭疗法。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('83', '南瓜', null, null, '无论你用它们来雕刻还是烹饪，南瓜都不会令人失望。请注意，南瓜确实需要大量的食物和较长的生长期（一般为75至100个无霜期），因此你需要在北方地区的5月下旬至极南各州的7月初种植它们。在所有霜冻的危险过去和土壤变暖之前，不要种植这种娇嫩的蔬菜，因为幼苗会受伤或腐烂。(见Almanac.com/Gardening网页上的霜冻日期。）尽管如此，如果你有足够的空间，南瓜很容易养护。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('84', '罗勒', null, null, '罗勒是一种多叶、芳香的一年生植物，外观呈灌木状。最常见的罗勒类型是甜罗勒；其他类型包括紫罗勒（比普通罗勒甜度低）、柠檬罗勒（柠檬味）和泰国罗勒（甘草味）。罗勒很容易种植，在意大利菜中效果很好，但它只在夏天生长，所以要有相应的计划。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('85', '芥菜', 'Chard', null, '芥菜是甜菜家族的一员，在凉爽和温暖的温度下都表现良好。它可以煮熟或在沙拉中生用，并含有大量维生素A和C。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('86', '花椰菜', null, null, '花椰菜是一种冷季作物，是普通卷心菜的后代。它比它的亲戚更难，因为它不太耐高温或寒冷。由于这个原因，花椰菜通常是商业化种植的。如果你打算尝试在家庭花园中种植花椰菜，它需要持续的低温，温度在60度左右。否则，它会过早地 \"扣\"-形成扣子大小的小头，而不是形成一个漂亮的白头。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('87', '薄荷糖', null, null, '薄荷是一种多年生植物，有非常芳香的齿状叶子和紫色、粉色或白色的小花。它有一种果味、芳香的味道。薄荷有很多品种，都有香味，无论是有光泽的还是有绒毛的，光滑的还是有皱纹的，翠绿的还是有斑纹的。然而，你总是可以通过它的方形茎来判断薄荷家族的成员。在你的手指间滚动它，你会注意到一股刺鼻的香味，并想到糖果、甜茶，甚至可能想到薄荷酒。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('88', '胡萝卜', null, null, '胡萝卜是一种受欢迎的根茎类蔬菜，容易在沙质土壤中生长。它们对大多数虫害和疾病都有抵抗力，是一种良好的晚季作物，可以耐受霜冻。不是所有的胡萝卜都是橙色的；品种的颜色从紫色到白色不等。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('89', '红薯', null, null, '红薯是一种源自热带的暖季蔓延性蔬菜。它是花园的一个很好的选择，因为它很容易种植，耐旱/耐热，而且病虫害少。红薯的营养也很丰富，热量很低。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('90', '夏天的南瓜', null, null, '南瓜是一种季节性蔬菜。它非常容易受到霜冻和高温的损害，但如果照顾得当，它可以用很少的植物生产出丰收的作物。夏季南瓜有许多品种可供选择，包括西葫芦。冬季和夏季品种之间的主要区别是它们的收获时间；较长的生长期使冬季南瓜的皮更硬，不能食用', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('91', '黄瓜', null, null, '黄瓜是一种暖季蔬菜，在春季最后一次霜冻日期之后不早于2周的时间内种植在地里。由于植物的攀援能力，大多数品种可以在任何空间内生长。最常见的切片黄瓜品种有蔓延的藤蔓，有大的绿叶和卷曲的卷须。这些植物的生长速度很快，如果你照顾得当，作物产量也很丰富。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('92', '迷迭香', null, null, '迷迭香是一种多年生常绿灌木，开蓝色的花。它是一种辛辣而独特的植物，具有甜味和树脂味。迷迭香是岩石花园或干墙顶的理想选择。它可用于家禽、羊肉、炖菜和汤。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('93', '萝卜', null, null, '萝卜是一种耐寒的冷季型蔬菜，由于它的成熟期很快，每季可以生产很多作物。萝卜可以在春季和秋季种植，但在温暖的月份应暂停种植。它们是一种非常容易种植的蔬菜。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('94', '韭菜', null, null, '韭菜是洋葱家族的一个多年生成员，开着美丽的紫色花朵。韭菜是冷季型、耐寒的多年生植物，在早春种植。种植这种草本植物时要注意，如果让花朵成熟，它就会占领你的花园（花朵会散落种子）。然而，如果这种植物淹没了你的花园，很容易挖出来并移走。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('95', '甜菜', null, null, '甜菜是一种冷季蔬菜作物。这种根茎类蔬菜生长迅速，有许多不同的品种，展示了不同形状的深红色、黄色或白色球茎。它们可以经受住霜冻和几乎冰冻的温度，这使它们成为北方园丁的一个很好的选择，也是一种优秀的长季节作物。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('96', '莴苣', null, null, '这是一种半耐寒的蔬菜，你可以通过一次种植一小批作物来保持整个季节的生长。到成熟的天数往往很短。花园生菜在口味和维生素A含量方面都远远优于超市品牌。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('97', '辣椒', null, null, '辣椒是一种柔嫩的、暖季的作物。它们能抵御大多数虫害，并为每个人提供一些东西：辣的、甜的或热的，以及各种颜色、形状和大小。在这一页，我们将重点介绍甜甜的甜椒。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('98', '芽甘蓝', null, null, '布鲁塞尔芽菜是卷心菜家族的一员，是蛋白质和维生素的绝佳来源。它们的生长期很长，一般来说，在秋季收获时种植更成功，因为只有在一两次轻度霜冻后它们的味道才会增加。', null, null, null, null, null, null, null, null, null);
INSERT INTO `tb_plant` VALUES ('99', '西红柿', null, null, '番茄是美国人最喜欢的花园蔬菜。(是的，从技术上讲，我们吃的是番茄植物的果实，但它在食用和烹饪中被当作蔬菜使用，因此，通常被归入蔬菜类）。这种藤本植物相当容易种植，只要照顾得当，就能获得丰收。它的用途很广泛，然而，西红柿容易受到一系列病虫害的影响。', null, null, null, null, null, null, null, null, null);
